import React, { Component } from "react";
import TenyesztokService from "../service/TenyesztokService";
class TenyesztokComponent extends Component {
  constructor(props) {
    super(props);

    this.state = {
      tenyesztok: [],
    };
  }

  componentDidMount() {
    TenyesztokService.getTenyesztok()
      .then((res) => {
        this.setState({ tenyesztok: res.data });
        console.log(this.state.data);
      })
      .catch(function (ex) {
        console.log("Response parsing failed. Error: ", ex);
      });
  }
  render() {
    return (
      <div>
        <table className="tagokTable">
          <thead>
            <tr>
              <th>Nev</th>

              <th>Cim</th>

              <th>Biro</th>

              <th>Telefonszam</th>
            </tr>
          </thead>
          <tbody>
            {this.state.tenyesztok.map((tulaj) => (
              <tr key={tulaj.id}>
                <td>{tulaj.nev}</td>
                <td>{tulaj.cim}</td>
                <td>{tulaj.biro}</td>
                <td>{tulaj.telszem}</td>
                <td>
                  <button className="infoBtn">Olvass tobbet</button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    );
  }
}

export default TenyesztokComponent;
